    const params = useParams();

    const itinerary = mockItineraries.filter(itinerary => itinerary.id === parseInt(params.itineraryId!))[0];
    console.log(itinerary)

    return (
        <>
            <div>{itinerary.name}</div>
            <LocationList locations={itinerary.locations}/>
        </>
    )
};
